import React, { Component } from "react";
import axios from "axios";

import logo from "./logo.svg";
import "./App.css";

class App extends Component {
  state = {
    data: ""
  };
  render() {
    var data = "abc";

    axios.get("http://127.0.0.1:5000/").then(res => {
      //console.log(res);
      data = res.data;
    });

    console.log(data);

    return (
      <div className="App">
        <header className="App-header">
          <p>{data}</p>
        </header>
      </div>
    );
  }
}

export default App;
